import React from "react";
import o1 from './ourClients/o1.png';
import o2 from './ourClients/o2.png';
import o3 from './ourClients/o3.png';
import o4 from './ourClients/o4.png';
import o5 from './ourClients/o5.png';
import o6 from './ourClients/o6.png';
import o7 from './ourClients/o7.png';
import o8 from './ourClients/o8.png';
import o9 from './ourClients/o9.png';
import o10 from './ourClients/o10.png';
import o11 from './ourClients/o11.png';
import o12 from './ourClients/o12.png';
import o13 from './ourClients/o13.png';
import o14 from './ourClients/o14.png';
// import o3 from './ourClients/o3.png';

export const IndustriesWeServe = (props) => {
  return (
    <div id="services">
      <div className="container">
        <div className="section-title text-center">
          <h2>Our Clients</h2>
        </div>
        <div className="logo-panel">
          <div className="logo-item">
            <img style={{ borderRadius: 10, marginBottom: 50 }} src={o1} width={250} height={100} />
            <div className="service-desc">
              <span className="logo-text">Saudi</span>
            </div>
          </div>
          <div className="logo-item">
            <img style={{ borderRadius: 10, marginBottom: 30 }} src={o13} width={150} height={120} />
            <div className="service-desc">
              <span className="logo-text">Saudi</span>
            </div>
          </div>
          <div className="logo-item">
            <img style={{ borderRadius: 10 }} src={o3} width={150} height={150} />
            <div className="service-desc">
              <span className="logo-text">Saudi</span>
            </div>
          </div>
        </div>
        <div className="logo-panel">
          <div className="logo-item">
            <img style={{ borderRadius: 10, marginBottom: 30 }} src={o4} width={250} height={120} />
            <div className="service-desc">
              <span className="logo-text">Saudi</span>
            </div>
          </div>
          <div className="logo-item">
            <img style={{ borderRadius: 10, marginBottom: 0 }} src={o5} width={160} height={150} />
            <div className="service-desc">
              <span className="logo-text">Saudi</span>
            </div>
          </div>
          <div className="logo-item">
            <img style={{ borderRadius: 10,marginBottom:30 }} src={o14} width={150} height={120} />
            <div className="service-desc">
              <span className="logo-text">Saudi</span>
            </div>
          </div>
        </div>
        <div className="logo-panel">
          <div className="logo-item">
            <img style={{ borderRadius: 10,  }} src={o7} width={200} height={150} />
            <div className="service-desc">
              <span className="logo-text">Saudi</span>
            </div>
          </div>
          <div className="logo-item">
            <img style={{ borderRadius: 10 }} src={o8} width={150} height={150} />
            <div className="service-desc">
              <span className="logo-text">Saudi</span>
            </div>
